import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { AppBar, Toolbar, Typography } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  title: {
    whiteSpace: "nowrap",
    overflow: "hidden",
    position: "relative",
    animation: `$moveText 7s linear infinite`, // Apply infinite left-to-right animation
    marginLeft: theme.spacing(2),
  },
  "@keyframes moveText": {
    "0%": {
      transform: "translateX(-100%)", // Start fully outside from the left
    },
    "100%": {
      transform: "translateX(100%)", // Move fully outside to the right
    },
  },
}));

export default function AppMainBar() {
  const classes = useStyles();

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h4" className={classes.title}>
          {"Ready to Reimburse?"}
        </Typography>
      </Toolbar>
    </AppBar>
  );
}
